IProtest (Al-Jazeera)

Sociopolitical Documentary hosted by Debby Chan, published by Al-Jazeera broadcasted as part of Al-Jazeera Activate series in 2013 - English narration


Information
------------------------------

Activist Debby Chan takes on one of the world's favourite brands in her fight for workers' rights.
Apple is one of the coolest brands on the planet but it is currently under the spotlight for all the wrong reasons. A spate of suicides at one of its main suppliers, Foxconn, has led to allegations of labour rights abuses in its Chinese factories. This film follows Debby Chan as she works to gather evidence against Foxconn and Apple, often at great risk to herself. An explosion at a Foxconn factory coincides with her arrival in the town and Debby's determined to uncover the cause of the explosion. But Foxconn is a powerful adversary and her mission proves to be a perilous one.

